import React from 'react'
import BasePageWithCard from '../BasePages/BasePageHugeCard';
import PublishOrdersForm from '../../components/Orders/PublishOrdersForm/PublishOrdersForm'

function PublishOrders({secretaryData}) {
  return (
    <BasePageWithCard isAuthenticated={true} data={secretaryData}>
     <PublishOrdersForm/>
    </BasePageWithCard>
  )
}

export default PublishOrders
